import React from 'react';
import user1 from './images/Tim2.jpeg';
import user2 from './images/Tim3.jpeg';
import user3 from './images/Tim2.jpeg';

import './Tertimonials.css';


const Tertimonials = () => {
    return (
        <div className='tertimonials'>
            <div className='container'>
                <h2>Tertimonials</h2>
                <span className='line'></span>
                <div className='content'>
                    <div className='card'>
                        <img src={user1} alt='user1' />
                        <p></p>
                        <p><span></span></p>

                    </div>
                </div>
            </div>
        </div >
    )
}

export default Tertimonials
